import FicharJogador from '../ficharJogador'
import './Time.css'

const Time = (props) => {
    const cssCorSegundaria = { background: props.corSegundaria }
    const cssCorPrimaria = {borderColor: props.corPrimaria}

    return (  
        <section className='time' style={cssCorSegundaria}>
            <h3 style={cssCorPrimaria}>{props.nome}</h3>
            <div>

            </div>
            {props.jogadores.map(jogador => <FicharJogador nome={jogador.nome} apelido={jogador.apelido} imagem={jogador.imagem}/>  )}
        </section>
    )
}

export default Time
